	////////////////////////////////////////////////////////////////////////////////

	public static CipherSuiteType valueOf(short code) {
		for (int i = 0; i < CipherSuiteType.values().length; i++) {
			if (code == CipherSuiteType.values()[i].code()) {
				return CipherSuiteType.values()[i];
			}
		}
		return null;
	}

	////////////////////////////////////////////////////////////////////////////////

	private short code;

	private final int keyExchangeAlgorithm;
	private final int signatureAlgorithm;
	private boolean exportable;

	private final String keyAlgorithm;
	private final String cipherAlgorithm;
	private final String digestAlgorithm;
	private final String macAlgorithm;

	private final int hash;
	private final int block;
	private final int tag;
	private final int key;
	private final int iv;

	private CipherSuiteType(short code,
			// 密钥交换算法，和证书签名算法
			int keyExchangeAlgorithm, int signatureAlgorithm, boolean exportable,
			// 密钥算法，加解密算法，摘要算法，认证算法
			String keyAlgorithm, String cipherAlgorithm, String digestAlgorithm, String macAlgorithm,
			// 哈希长度，块长度，标记长度，密钥长度，向量长度
			int hash, int block, int tag, int key, int iv) {
		this.code = code;

		this.keyExchangeAlgorithm = keyExchangeAlgorithm;
		this.signatureAlgorithm = signatureAlgorithm;
		this.exportable = exportable;

		this.keyAlgorithm = keyAlgorithm;
		this.cipherAlgorithm = cipherAlgorithm;
		this.digestAlgorithm = digestAlgorithm;
		this.macAlgorithm = macAlgorithm;

		this.hash = hash;
		this.block = block;
		this.tag = tag;
		this.key = key;
		this.iv = iv;
	}

	public short code() {
		return code;
	}

	/** 密钥交换算法 */
	public int keyExchangeAlgorithm() {
		return keyExchangeAlgorithm;
	}

	/** 证书签名算法 */
	public int signatureAlgorithm() {
		return signatureAlgorithm;
	}

	public boolean exportable() {
		return exportable;
	}

	/** 认证算法 */
	public String macAlgorithm() {
		return macAlgorithm;
	}

	/** 摘要算法 */
	public String digestAlgorithm() {
		return digestAlgorithm;
	}

	/** 加解密算法 */
	public String cipherAlgorithm() {
		return cipherAlgorithm;
	}

	/** 密钥算法 */
	public String keyAlgorithm() {
		return keyAlgorithm;
	}

	/** 摘要算法和认证算法的结果长度(byte) */
	public int hash() {
		return hash;
	}

	/** 加解密流量块(byte) */
	public int block() {
		return block;
	}

	/** 加解密密钥(byte) */
	public int key() {
		return key;
	}

	/** 加解密标记(byte) */
	public int tag() {
		return tag;
	}

	/** 加解密向量(byte) */
	public int iv() {
		return iv;
	}
